import React, {Component} from 'react';
import {Table} from 'react-bootstrap'; 

export class TeamInfo extends Component {

    constructor(props) {
        super(props);
        this.state ={teams:[]}
    }
    render(){
        return(
           <Table className="mt-4" stripped bordered hover size="sm">
               <thead>
                   <tr>
                       <th>Tournament ID</th>
                       <th>Team Name</th>
                       <th>Team Age Group</th>
                       <th>Team Contact Name</th>
                       <th>Team Contact Phone Number</th>
                       <th>Team Contact Email</th>
                   </tr>
               </thead>

           </Table>
        )


    }
}
